import React from 'react';
import {ReactComponent  as Logo} from '../../resources/images/jplogo.svg';

import "./header.scss";


const menu_bar = () => {
    return (
        <nav>
            <ul>
                <li><Logo fill="red" className="logo" width={150} height={150} /></li>
                <li>about</li>
                <li>portfolio</li>
                <li>blog</li>
                <li>HOME</li>
            </ul>
        </nav>
    );
};

export default menu_bar;
